    i0.ɵɵelementStart(1, "p", 38);
    i0.ɵɵtext(2, "German color standard, developed in 1927 by the State Committee for Supply Conditions at the request of paint manufacturers. The RAL Institute established a standard for the color space, dividing it into ranges and identifying each color with a single-digit number index. Numerous notations accompanying the color examples guarantee a clear and concise means of communication that is understandable in many areas of industry.");
