    i0.ɵɵelementStart(0, "div", 19);
    i0.ɵɵelementStart(1, "p", 38);
    i0.ɵɵtext(2, "\u041D\u0456\u043C\u0435\u0446\u044C\u043A\u0438\u0439 \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442 \u043A\u043E\u043B\u044C\u043E\u0440\u0443, \u0440\u043E\u0437\u0440\u043E\u0431\u043B\u0435\u043D\u0438\u0439 \u0443 1927 \u0440\u043E\u0446\u0456 \u0414\u0435\u0440\u0436\u0430\u0432\u043D\u0438\u043C \u043A\u043E\u043C\u0456\u0442\u0435\u0442\u043E\u043C \u0437 \u0443\u043C\u043E\u0432 \u043F\u043E\u0441\u0442\u0430\u0447\u0430\u043D\u043D\u044F \u043D\u0430 \u043F\u0440\u043E\u0445\u0430\u043D\u043D\u044F \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u043A\u0456\u0432 \u043B\u0430\u043A\u043E\u0444\u0430\u0440\u0431\u043E\u0432\u043E\u0457 \u043F\u0440\u043E\u0434\u0443\u043A\u0446\u0456\u0457. \u0406\u043D\u0441\u0442\u0438\u0442\u0443\u0442 RAL \u0432\u0441\u0442\u0430\u043D\u043E\u0432\u0438\u0432 \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442 \u0434\u043B\u044F \u043A\u043E\u043B\u0456\u0440\u043D\u043E\u0433\u043E \u043F\u0440\u043E\u0441\u0442\u043E\u0440\u0443, \u0440\u043E\u0437\u0434\u0456\u043B\u0438\u0432\u0448\u0438 \u0439\u043E\u0433\u043E \u043D\u0430 \u0434\u0456\u0430\u043F\u0430\u0437\u043E\u043D\u0438 \u0456 \u043F\u043E\u0437\u043D\u0430\u0447\u0438\u0432\u0448\u0438 \u043A\u043E\u0436\u0435\u043D \u043A\u043E\u043B\u0456\u0440 \u043E\u0434\u043D\u043E\u0437\u043D\u0430\u0447\u043D\u0438\u043C \u0446\u0438\u0444\u0440\u043E\u0432\u0438\u043C \u0456\u043D\u0434\u0435\u043A\u0441\u043E\u043C. \u0427\u0438\u0441\u043B\u0435\u043D\u043D\u0456 \u043F\u043E\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F, \u0449\u043E \u0441\u0443\u043F\u0440\u043E\u0432\u043E\u0434\u0436\u0443\u044E\u0442\u044C \u043F\u0440\u0438\u043A\u043B\u0430\u0434\u0438 \u043A\u043E\u043B\u044C\u043E\u0440\u0456\u0432, \u0433\u0430\u0440\u0430\u043D\u0442\u0443\u044E\u0442\u044C \u0447\u0456\u0442\u043A\u0438\u0439 \u0456 \u043B\u0430\u043A\u043E\u043D\u0456\u0447\u043D\u0438\u0439 \u0437\u0430\u0441\u0456\u0431 \u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0457, \u0437\u0440\u043E\u0437\u0443\u043C\u0456\u043B\u0438\u0439 \u0443 \u0431\u0430\u0433\u0430\u0442\u044C\u043E\u0445 \u0433\u0430\u043B\u0443\u0437\u044F\u0445 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456.");
